use std::{collections::HashMap, path::PathBuf};

use env_logger::Target;
use log::LevelFilter;
use scfia_lib::elf;
use scfia_lib::{
    memory::volatile_memory_region::VolatileMemoryRegion,
    system_states::aarch64::ScfiaAarch64SystemState, values::value8::Value8,
};

fn main() {
    let _ = env_logger::builder()
        .filter(None, LevelFilter::Debug)
        .target(Target::Stdout)
        .try_init();
        from_checkpoint();
}

pub fn from_begin() {
    let mut s0 = ScfiaAarch64SystemState::new();

    elf::load_elf("./router", &mut s0.memory); // text and stack
    s0.memory.add_volatile_region(0x0a003e00..0x0a004000); // ingress nic mmio register
    s0.memory.add_volatile_region(0x0a003c00..0x0a003e00); // egress nic mmio register
    s0.memory.add_volatile_region(0x46004000..0x46005000); // ingress nic receivequeue driver area
    s0.memory.add_volatile_region(0x46005000..0x46008000); // ingress nic receivequeue device area
    s0.memory.add_volatile_region(0x46008000..0x46408000); // ingress nic receivequeue buffers
    s0.memory.add_volatile_region(0x4640c000..0x4640d000); // ingress nic snedqueue driver area
    s0.memory.add_volatile_region(0x4640d000..0x46410000); // ingress nic sendqueue device area
    s0.memory.add_volatile_region(0x46410000..0x46810000); // ingress nic sendqueue buffers
    s0.memory.add_volatile_region(0x46814000..0x46815000); // egress nic receivequeue driver area
    s0.memory.add_volatile_region(0x46815000..0x46818000); // egress nic receivequeue device area
    s0.memory.add_volatile_region(0x46818000..0x46c18000); // egress nic receivequeue buffers
    s0.memory.add_volatile_region(0x46c1c000..0x46c1d000); // egress nic receivequeue driver area
    s0.memory.add_volatile_region(0x46c1d000..0x46c20000); // egress nic sendqueue device area
    s0.memory.add_volatile_region(0x46c20000..0x47020000); // egress nic sendqueue buffers

    // ingress nic receivwqueue descriptor area
    let mut heap: HashMap<u64, Value8> = HashMap::new();
    for i in 0..0x4000 {
        heap.insert(0x46000000 + i as u64, Value8::Concrete(0));
    }
    s0.memory.add_stable_region(heap, 0x46000000..0x46004000);

    // ingress nic send queue descriptor area
    let mut heap: HashMap<u64, Value8> = HashMap::new();
    for i in 0..0x4000 {
        heap.insert(0x46408000 + i as u64, Value8::Concrete(0));
    }
    s0.memory.add_stable_region(heap, 0x46408000..0x4640c000);

    // egress nic receive queue descriptor area
    let mut heap: HashMap<u64, Value8> = HashMap::new();
    for i in 0..0x4000 {
        heap.insert(0x46810000 + i as u64, Value8::Concrete(0));
    }
    s0.memory.add_stable_region(heap, 0x46810000..0x46814000);

    // egress nic send queue descriptor area
    let mut heap: HashMap<u64, Value8> = HashMap::new();
    for i in 0..0x4000 {
        heap.insert(0x46c18000 + i as u64, Value8::Concrete(0));
    }
    s0.memory.add_stable_region(heap, 0x46c18000..0x46c1c000);

    s0.pc = 0x40081550; // _start

    let exits = [
        0x400856F0, // panic
        0x400857B4, // main loop begin
    ];
    s0.step_until(&exits);
}

